(10, 1, '2023-05-18 05:37:32', '2023-05-18 05:37:32', '<div class=\"container home-intro-products\">\r\n<div class=\"row flex-wrap home-collection-flex\">\r\n<div class=\"col-4\"><a href=\"/products/2-5-yard-golden-zari-kani-jamawar-pashmina-shawl\">\r\n<img src=\"//purekashmir.com/cdn/shop/products/DSC_0608_67667d8e-e2d8-4904-bcbb-34b9d566cd2f_grande.jpg?v=1671518809\" alt=\"2.5 Yard Golden Zari Kani Jamawar Pashmina Shawl\" />\r\n</a></div>\r\n<div class=\"col-4\"><a href=\"/products/3-yard-ivory-kani-jamawar-pashmina-shawl\">\r\n<img src=\"//purekashmir.com/cdn/shop/products/dsc_0197_52090341141_o_grande.jpg?v=1654500904\" alt=\"3 Yard Ivory Kani Jamawar Pashmina Shawl\" />\r\n</a></div>\r\n<div class=\"col-4\"><a href=\"/products/striped-rose-kani-jamawar-pashmina-shawl\">\r\n<img src=\"//purekashmir.com/cdn/shop/products/DSC_0601_b4044257-c54a-4f69-930f-7593eedc6900_grande.jpg?v=1671519152\" alt=\"Striped Rose Kani Jamawar Pashmina Shawl\" />\r\n</a></div>\r\n<div class=\"col-4\"><a href=\"/products/copy-of-ivory-kani-jamawar-pashmina-shawl\">\r\n<img src=\"//purekashmir.com/cdn/shop/products/ivory_kani_collection_pic_dd644875-e4f3-471a-b765-b9448422eba4_grande.jpg?v=1654418100\" alt=\"Ivory Kani Jamawar Pashmina Shawl\" />\r\n</a></div>\r\n<div class=\"col-4\"><a href=\"/products/black-base-rose-kani-jamawar-pashmina-shawl\">\r\n<img src=\"//purekashmir.com/cdn/shop/products/DSC_0574_21f92f57-8438-4830-b3ba-6e96b0fee904_grande.jpg?v=1671519508\" alt=\"Black Base Rose Kani Jamawar Pashmina Shawl\" />\r\n</a></div>\r\n<div class=\"col-4\"><a href=\"/products/ivory-kani-jamawar-pashmina-shawl-10\">\r\n<img src=\"//purekashmir.com/cdn/shop/products/natural_kani_collection_pic_grande.jpg?v=1654418273\" alt=\"Natural Kani Jamawar Pashmina Shawl\" />\r\n</a></div>\r\n</div>\r\n</div>', 'Module-2', '', 'trash', 'open', 'closed', '', 'module-2__trashed', '', '', '2023-05-19 06:42:34', '2023-05-19 06:42:34', '', 0, 'http://html2pdf.local/kashmir/?post_type=html_module&#