(12, 1, '2023-05-18 05:38:47', '2023-05-18 05:38:47', '<div class=\"container home-intro-products\">\r\n            \r\n          <div class=\"row flex-wrap home-collection-flex\">\r\n                        <div class=\"col-4 text-col\">\r\n              <div class=\"home-collection-text-wrapper\">\r\n                <h3> Authentic Pashmina Jamawar Embroidery</h3>\r\n                <p>The very best of Kashmir’s Craftsmanship, exquisitely hand embroidered and fully hand made these shawls are an epitome of Kashmir’s rich arts and crafts. Each of these shawls, is embroidered heavily all across the shawl and takes anywhere between 6 to 36 months to complete.</p>\r\n                <a href=\"/collections/jamawar-embroidery\">View Collection</a>\r\n              </div>\r\n            </div>\r\n            \r\n                <div class=\"col-4\">\r\n                  <a href=\"/products/copy-of-multi-color-jamawar-embroidery-pashmina-shawl\">\r\n                      <img src=\"//purekashmir.com/cdn/shop/files/DSC_0719_915086d1-83f0-43f5-b8e0-9267721c10e2_grande.jpg?v=1684230175\" alt=\"Ivory Base Blue Embroidery Jamawar Pashmina Shawl\">\r\n                  </a>\r\n                </div>\r\n            \r\n                <div class=\"col-4\">\r\n                  <a href=\"/products/black-base-jamawar-multi-color-embroidery-cashmere-pashmina-shawl\">\r\n                      <img src=\"//purekashmir.com/cdn/shop/files/DSC_0721_eb96d8d3-09f1-4b54-ab9e-bdb131ee2339_grande.jpg?v=1684232089\" alt=\"Black Base Jamawar Multi-color Embroidery Cashmere Pashmina Shawl\">\r\n                  </a>\r\n                </div>\r\n            \r\n                <div class=\"col-4\">\r\n                  <a href=\"/products/copy-of-multicolor-jamawar-embroidery-cashmere-pashmina-shawl\">\r\n                      <img src=\"//purekashmir.com/cdn/shop/products/DSC_0135_3f6645f7-467e-496a-bfaf-d563f779ed9c_grande.jpg?v=1671697162\" alt=\"2.5 Yard Lemon Base Jamawar  Embroidery Cashmer