(36, 1, '2023-05-20 07:16:16', '2023-05-20 07:16:16', 'SM83PB/25\r\nSize\r\n100 X 200 CMS or 39 X 79 INCHES\r\n\r\nWeight \r\n250 gms or 9 oz\r\n\r\nProcess\r\nHand Loom Weaving\r\nTime taken to Weave: 4 to 7 days\r\nSozni Hand Embroidery\r\nTime taken to Embroider: 18 Months\r\nMade in Kashmir, India\r\n\r\nComposition\r\n100% Kashmir Pashmina Cashmere *\r\n\r\nNote\r\nThis product it handmade and slight variations in its fabrication make the piece authentic and truly beautiful. Please note the actual fabric colors may vary due to differences in monitor color depth and make. The color shown is as close as possible to the actual colors of the shawls.', '2.5 Yard Lemon Base Jamawar Embroidery Cashmere Pashmina Shawl', '', 'publish', 'open', 'closed', '', '2-5-yard-lemon-base-jamawar-embroidery-cashmere-pashmina-shawl', '', '', '2023-05-20 07:16:40', '2023-05-20 07:16:40', '', 0, 'http://html2pdf.local/kashmir/?post_type=products&#038;p=36', 0, 'products', '', 0),
