(38, 1, '2023-05-20 07:25:37', '2023-05-20 07:25:37', '<div class=\"about-sec-2\">\r\n  <div class=\"about-row\">\r\n    <div class=\"about-middle\">\r\n      <div class=\"align-middle\">\r\n      	<h2>Inspiration</h2>\r\n      	<p>Growing up watching my grandfather, Late Ali Mohammad Beig, assiduously embroidering a Pashmina shawl, who gave his everything to create these cherished pieces of art, our inspiration was clear: keep working with artisans as a family and never compromise on quality.</p>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>', 'module-6', '', 'publish', 'closed', 'closed', '', 'module-6', '', '', '2023-05-20 07:28:28', '2023-05-20 07:28:28', '', 0, 'http://html2pdf.local/kashmir/?post_type=html_module&#038;p=38', 0, 'html_module', '', 0);
